contracts/BridgeManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "./ValidatorRegistry.sol";
import "./MessageVerifier.sol";


contract BridgeManager is
    UUPSUpgradeable,
    OwnableUpgradeable,
    ReentrancyGuardUpgradeable
{

    ValidatorRegistry public validatorRegistry; // Guardian set registry
    MessageVerifier public verifier;            // VAA hashing logic

    // Replay protection: emitterChainId => emitterAddress => lastSequence
    mapping(uint16 => mapping(bytes32 => uint64)) public lastSequence;

    // Optional: consumed VAAs (extra layer)
    mapping(bytes32 => bool) public consumedVAAs;

    uint16 public chainId; // Local chain ID


    event VAAConsumed(
        bytes32 indexed vaaHash,
        uint16 indexed emitterChainId,
        bytes32 indexed emitterAddress,
        uint64 sequence
    );

    event ETHUnlocked(
        address indexed recipient,
        uint256 amount,
        bytes32 indexed orderId
    );


    constructor() {
        _disableInitializers();
    }

    function initialize(
        uint16 _chainId,
        address _validatorRegistry,
        address _verifier
    ) external initializer {
        require(_chainId != 0, "BridgeManager: invalid chainId");
        require(_validatorRegistry != address(0), "BridgeManager: zero registry");
        require(_verifier != address(0), "BridgeManager: zero verifier");

        chainId = _chainId;
        validatorRegistry = ValidatorRegistry(_validatorRegistry);
        verifier = MessageVerifier(_verifier);

        __Ownable_init(msg.sender);
        __ReentrancyGuard_init();
    }


    function _authorizeUpgrade(address) internal override onlyOwner {}


    receive() external payable {}


    function executeVAA(
        uint8 version,
        uint32 guardianSetIndex,
        uint16 emitterChainId,
        bytes32 emitterAddress,
        uint64 sequence,
        bytes calldata payload,
        bytes[] calldata signatures
    ) external nonReentrant {
        // Build VAA hash
        bytes32 vaaHash = verifier.hashVAA(
            version,
            guardianSetIndex,
            emitterChainId,
            emitterAddress,
            sequence,
            payload
        );

        // Replay protection
        require(!consumedVAAs[vaaHash], "BridgeManager: VAA already consumed");
        require(sequence > lastSequence[emitterChainId][emitterAddress], "BridgeManager: sequence too low");

        // Verify guardian signatures
        bool valid = validatorRegistry.verifySignatures(
            guardianSetIndex,
            vaaHash,
            signatures
        );
        require(valid, "BridgeManager: Invalid guardian signatures");

        // Mark VAA consumed and update sequence
        consumedVAAs[vaaHash] = true;
        lastSequence[emitterChainId][emitterAddress] = sequence;

        // Execute payload
        _executePayload(payload);

        emit VAAConsumed(vaaHash, emitterChainId, emitterAddress, sequence);
    }

    function _executePayload(bytes calldata payload) internal {
        (uint8 payloadId, bytes32 orderId, address recipient, uint256 amount) =
            abi.decode(payload, (uint8, bytes32, address, uint256));

        require(payloadId == 1, "BridgeManager: Unknown payload type");
        require(recipient != address(0), "BridgeManager: zero recipient");
        require(amount > 0, "BridgeManager: zero amount");

        // Transfer ETH
        (bool sent, ) = payable(recipient).call{value: amount}("");
        require(sent, "BridgeManager: ETH transfer failed");

        emit ETHUnlocked(recipient, amount, orderId);
    }


    function isVAAConsumed(bytes32 vaaHash) external view returns (bool) {
        return consumedVAAs[vaaHash];
    }

    function getLastSequence(uint16 emitterChainId, bytes32 emitterAddress) external view returns (uint64) {
        return lastSequence[emitterChainId][emitterAddress];
    }
}

contracts/MessageVerifier.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;


contract MessageVerifier {

    // Wormhole VAA domain prefix
    bytes1 private constant VAA_PREFIX = 0x01;



    function hashVAA(
        uint8 version,
        uint32 guardianSetIndex,
        uint16 emitterChainId,
        bytes32 emitterAddress,
        uint64 sequence,
        bytes calldata payload
    ) public pure returns (bytes32) {
        return keccak256(
            abi.encodePacked(
                VAA_PREFIX,
                version,
                guardianSetIndex,
                emitterChainId,
                emitterAddress,
                sequence,
                payload
            )
        );
    }



    function hashPayload(bytes calldata payload) external pure returns (bytes32) {
        return keccak256(payload);
    }
}

contracts/SCAITokenLocker.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "./ValidatorRegistry.sol";
import "./MessageVerifier.sol";


contract SCAITokenLocker is UUPSUpgradeable, OwnableUpgradeable, ReentrancyGuardUpgradeable {


    uint256 public totalLocked;

    // Mapping of lock orderId => locked amount
    mapping(bytes32 => uint256) public lockedOrders;

    // Mapping of orderId / VAA => executed
    mapping(bytes32 => bool) public executedVAAs;

    // Wormhole components
    MessageVerifier public verifier;
    ValidatorRegistry public validatorRegistry;


    event Locked(address indexed sender, uint256 amount, bytes32 indexed orderId);
    event Unlocked(address indexed recipient, uint256 amount, bytes32 indexed orderId);


    function initialize(address _verifier, address _validatorRegistry) external initializer {
        require(_verifier != address(0), "SCAITokenLocker: zero verifier");
        require(_validatorRegistry != address(0), "SCAITokenLocker: zero validatorRegistry");

        verifier = MessageVerifier(_verifier);
        validatorRegistry = ValidatorRegistry(_validatorRegistry);

        __Ownable_init(msg.sender);
        __ReentrancyGuard_init();
    }

    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    receive() external payable {}


    function lock() external payable nonReentrant returns (bytes32) {
        require(msg.value > 0, "SCAITokenLocker: Must lock >0");

        totalLocked += msg.value;

        bytes32 orderId = keccak256(
            abi.encodePacked(msg.sender, msg.value, block.timestamp, block.number)
        );

        lockedOrders[orderId] = msg.value;

        emit Locked(msg.sender, msg.value, orderId);
        return orderId;
    }

    struct UnlockParams {
        address recipient;
        uint256 amount;
        bytes32 orderId;
        bytes[] signatures;
        uint8 vaaVersion;
        uint32 guardianSetIndex;
        uint16 emitterChainId;
        bytes32 emitterAddress;
        uint64 sequence;
        bytes payload;
    }

    function unlock(UnlockParams calldata p) external nonReentrant {
        require(p.recipient != address(0), "SCAITokenLocker: zero recipient");
        require(p.amount > 0, "SCAITokenLocker: zero amount");
        require(!executedVAAs[p.orderId], "SCAITokenLocker: Already executed");

        uint256 lockedAmount_ = lockedOrders[p.orderId];
        require(lockedAmount_ >= p.amount, "SCAITokenLocker: Insufficient locked funds");

        bytes32 vaaHash = verifier.hashVAA(
            p.vaaVersion,
            p.guardianSetIndex,
            p.emitterChainId,
            p.emitterAddress,
            p.sequence,
            p.payload
        );


        require(
            validatorRegistry.verifySignatures(p.guardianSetIndex, vaaHash, p.signatures),
            "SCAITokenLocker: Invalid signatures"
        );

        // Mark as executed before transfer (reentrancy protection)
        executedVAAs[p.orderId] = true;
        totalLocked -= p.amount;
        lockedOrders[p.orderId] = lockedAmount_ - p.amount;

        // Transfer ETH
        (bool sent, ) = payable(p.recipient).call{value: p.amount}("");
        require(sent, "SCAITokenLocker: ETH transfer failed");

        emit Unlocked(p.recipient, p.amount, p.orderId);
    }


    function isVAAConsumed(bytes32 orderId) external view returns (bool) {
        return executedVAAs[orderId];
    }
}

contracts/ValidatorRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";


contract ValidatorRegistry is OwnableUpgradeable {

    struct GuardianSet {
        address[] guardians;
        uint256 expirationTime; // unix timestamp when this set expires
    }


    // Current active guardian set index
    uint32 public currentSetIndex;

    // Mapping from set index to GuardianSet
    mapping(uint32 => GuardianSet) public guardianSets;

    // Number of signatures required to validate a VAA
    mapping(uint32 => uint256) public thresholds;

    event GuardianSetUpdated(uint32 indexed index, address[] guardians, uint256 expirationTime);
    event ThresholdUpdated(uint32 indexed index, uint256 threshold);


    function initialize(address[] memory _guardians, uint256 _threshold) external initializer {
        __Ownable_init(msg.sender);

        require(_guardians.length > 0, "ValidatorRegistry: empty guardians");
        require(_threshold > 0 && _threshold <= _guardians.length, "ValidatorRegistry: invalid threshold");

        currentSetIndex = 0;
        guardianSets[currentSetIndex] = GuardianSet({
            guardians: _guardians,
            expirationTime: type(uint256).max
        });
        thresholds[currentSetIndex] = _threshold;

        emit GuardianSetUpdated(currentSetIndex, _guardians, type(uint256).max);
        emit ThresholdUpdated(currentSetIndex, _threshold);
    }


    function updateGuardianSet(address[] calldata _guardians, uint256 _expirationTime, uint256 _threshold) external onlyOwner {
        require(_guardians.length > 0, "ValidatorRegistry: empty guardians");
        require(_expirationTime > block.timestamp, "ValidatorRegistry: expiration must be future");
        require(_threshold > 0 && _threshold <= _guardians.length, "ValidatorRegistry: invalid threshold");

        currentSetIndex += 1;
        guardianSets[currentSetIndex] = GuardianSet({
            guardians: _guardians,
            expirationTime: _expirationTime
        });
        thresholds[currentSetIndex] = _threshold;

        emit GuardianSetUpdated(currentSetIndex, _guardians, _expirationTime);
        emit ThresholdUpdated(currentSetIndex, _threshold);
    }


    function verifySignatures(uint32 setIndex, bytes32 hash, bytes[] calldata signatures) external view returns (bool) {
        GuardianSet memory set = guardianSets[setIndex];
        uint256 threshold = thresholds[setIndex];
        uint256 sigCount = signatures.length;
        if (sigCount < threshold) return false;

        uint256 seenBitmap = 0;
        uint256 validCount = 0;

        for (uint256 i = 0; i < sigCount; i++) {
            address signer = _recoverSigner(hash, signatures[i]);

            // Find signer index
            int256 signerIndex = -1;
            for (uint256 j = 0; j < set.guardians.length; j++) {
                if (set.guardians[j] == signer) {
                    signerIndex = int256(j);
                    break;
                }
            }
            if (signerIndex < 0) continue; // signer not in set

            // Prevent duplicate signatures using bitmap
            if ((seenBitmap & (1 << uint256(signerIndex))) != 0) continue;

            seenBitmap |= (1 << uint256(signerIndex));
            validCount++;

            if (validCount >= threshold) return true;
        }

        return false;
    }


    function _recoverSigner(bytes32 hash, bytes memory signature) internal pure returns (address) {
        require(signature.length == 65, "ValidatorRegistry: invalid signature length");
        bytes32 r;
        bytes32 s;
        uint8 v;

        assembly {
            r := mload(add(signature, 32))
            s := mload(add(signature, 64))
            v := byte(0, mload(add(signature, 96)))
        }

        if (v < 27) v += 27;
        require(v == 27 || v == 28, "ValidatorRegistry: invalid v");

        address signer = ecrecover(hash, v, r, s);
        require(signer != address(0), "ValidatorRegistry: invalid signer");
        return signer;
    }

    /// -----------------------------------------------------------------------
    /// View Helpers
    /// -----------------------------------------------------------------------
    function guardianCount(uint32 setIndex) external view returns (uint256) {
        return guardianSets[setIndex].guardians.length;
    }

    function getGuardian(uint32 setIndex, uint256 index) external view returns (address) {
        require(index < guardianSets[setIndex].guardians.length, "ValidatorRegistry: index out of bounds");
        return guardianSets[setIndex].guardians[index];
    }
}

